import React, { Component } from "react";
import "./navbar.css";

export default class NavBar extends Component {
  render() {
    return (
      <div class="navbar">
        <h1 class="navbar_h1">WatchIt</h1>
        <h2 class="navbar_h2">Favourites</h2>
        <h2 class="navbar_h2">Leaderboard</h2>
        <h2 class="navbar_h2">Logout</h2>
      </div>
    );
  }
}
